import React, { Component } from 'react';
import FeedbackItem from './FeedbackItem';

class Feedback extends Component {
  render() {
    return this.props.feedbacks.map((feedback)=>(
       <FeedbackItem feedback ={feedback} />
    ));
  }
}

export default Feedback;
